    yearRange: "2021 - 2023",
    title: "Yapay Zekâ ile Enerji Sistemlerinin Optimizasyonu",
    description: "Sürdürülebilir Enerji",
    fundingSource: "Ulusal Fon",
    team: "Selçuklu S. B., Karaca A., Güneş E.",
    summaryLink: "#", // Proje özetine gidecek link
  },
  {
    yearRange: "2020 - 2022",
    title: "Büyük Veri ile Yenilenebilir Enerji Sistemlerinin Analizi",
    description: "Yenilikçi Çözümler",
    fundingSource: "Avrupa Birliği Projesi",
    team: "Selçuklu S. B., Özdemir Y., Çetin A., Aksoy M.",
    summaryLink: "#", // Proje özetine gidecek link
  },
];

const Research = () => {
  return <ResearchProject projects={projects} />;
};

export default Research;
